05.02.03 - Texnologik mashinalar, robotlar, mexatronika va robototexnika tizimlari;
05.06.04 - Tikuvchilik buyumlari texnologiyasi va kostyum dizayni.
2019 yil noyabr oyida tayanch doktorantura 2-bosqich doktorantlari Yu.Kupalova va Z.Shodmonqulovlar, 2-bosqich mustaqil izlanuvchilari N.Nabiyev va M.Ochilovlarning dissertatsiya ishlari kafedralararo ilmiy seminarda muhokamasi o‘tkazildi va ixtisoslashtirilgan ilmiy kengash qoshidagi ilmiy seminar muhokamasiga tavsiya etildi.
