2. Tayanch doktorant Z.A.Shodmonqulov uchun 2020 yil 25-27 fevral kunlari quyidagi fanlardan qo‘shimcha imtihonlar o‘tkazilsin:
- “Texnologik jarayonlar tizimlarini nazariy asoslari”;
- “Mashinasozlikda texnologik jarayonlarni loyihalashni ilmiy asoslari”;
- “Tarmoq mashinalarini texnik diagnostikasi va tadqiqot asoslari”.
(OAK Rayosatining 27.06.2017 y. 240/2-son qarori; OAK Tartib - qoida komissiyasining 16.12.2019 y. 12/11-son qarori).

Endi qamoqxonadagi nazoratchilarga ham bodikamera «taqib qo‘yiladi»
Hukumatning tegishli qarori bilan Jazoni ijro etish tizimi xodimlarining shaxsiy videoregistratorlar (bodikameralar) bilan ta’minlangan holda xizmatni o‘tash tartibi to‘g‘risidagi nizom tasdiqlandi.
Nizomga ko‘ra, har kunlik ish faoliyatini olib borayotgan yoki kunlik xizmatga jalb etilgan xodim mahkumlarni uzluksiz nazorat qilish hamda ular tomonidan jinoyat va tartibbuzarliklar sodir etilishini aniqlash uchun bodikameralar bil
... 
mahkumlarni ishga olib chiqish va undan qaytishda;
- mahkumlar va fuqarolarni qabul qilish jarayonida;
- fuqarolardan olingan yo‘qlovlarni qabul qilishda hamda posilka yoki yo‘qlov va banderollarni tarqatish vaqtida;
- mahkumlarning ariza va shikoyatlarini ko‘rib chiqishda;
- mahkumlarning uchrashuvlarini o‘tkazish jarayonida;
- mahkumlarga nisbatan intizomiy jazo va rag‘batlantirish choralari qo‘llanilayotgan vaqtda hamda mahkumlar intizomiy bo‘linmaga kiritilayotganda va chiqarilayotganda;
- m
...
a o‘z xohishi bilan o‘chirib qo‘yish taqiqlanadi. Bodikamera xizmat vaqtida doimo ishchi holatda bo‘lishi shart.
Mahkum tomonidan xodimga xizmat davomida berilgan bodikameraga ziyon yetkazish, uni olib qo‘yishga urinish taqiqlanadi.
Shuningdek, mahkumlar bilan bodikamera orqali yozib olingan suhbatlarni Internetga joylashtirish, mahkumning oila a’zolariga va boshqa shaxslarga berish taqiqlanadi.
